import React from 'react';
import { View, Text, ScrollView, Image, ImageSourcePropType, StyleSheet } from 'react-native';

interface Props { }

interface State { }

class InicioView extends React.Component<Props, State> {
  _buildImageWithText(imagePath: ImageSourcePropType, text: string, textP: string) {
    return (
      <View style={styles.imageContainer}>
        <Image
          source={imagePath}
          style={styles.image}
        />
        <Text style={{ fontSize: 16, fontWeight: 'bold' }}>{text}</Text>
        <Text style={{ fontSize: 16, fontWeight: 'bold', color: '#FF23FF' }}> {textP}</Text>
      </View>
    );
  }

  render() {
    return (
      <View style={styles.container}>
        <ScrollView>
          <View style={{ alignItems: 'center' }}>
            <Image
              source={require('../assets/images/banner.png')}
              style={{ width: '100%', height: 130 }}
              resizeMode="cover"
            />
          </View>
          <Text style={{ fontWeight: 'bold', fontSize: 30, marginLeft: 12 }}>Brands</Text>
          <View style={{ alignItems: 'center' }}>
            <Image
              source={require('../assets/images/brands.png')}
              style={{ width: '100%', height: 110 }}
              resizeMode="cover"
            />
          </View>
          <Text style={{ fontWeight: 'bold', fontSize: 30, marginLeft: 12 }}>Fetured</Text>
          <ScrollView horizontal={true}>
            <View style={{ flexDirection: 'row' }}>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/halo4.jpg'), 'Halo 4', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/halo5.jpg'), 'Halo 5', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/haloinfinite.jpg'), 'Halo Infinite', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/kirby.jpg'), 'Kirby and the forgotten lands', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/zelda.jpg'), 'Zelda: TOTK', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/pokemon.jpg'), 'Pokemon Scarlet', '$1000.00')}
              </View>
            </View>
          </ScrollView>
          <Text style={{ fontWeight: 'bold', fontSize: 30, marginLeft: 12 }}>Offers</Text>
          <ScrollView horizontal={true}>
            <View style={{ flexDirection: 'row' }}>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/kirby.jpg'), 'Kirby and the forgotten lands', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/zelda.jpg'), 'Zelda: TOTK', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/pokemon.jpg'), 'Pokemon Scarlet', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/halo4.jpg'), 'Halo 4', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/halo5.jpg'), 'Halo 5', '$1000.00')}
              </View>
              <View style={{ paddingRight: 16 }}>
                {this._buildImageWithText(require('../assets/images/haloinfinite.jpg'), 'Halo Infinite', '$1000.00')}
              </View>
            </View>
          </ScrollView>
        </ScrollView>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    margin: 16,
  },
  imageContainer: {
    marginRight: 16,
    width: 100,
  },
  image: {
    width: '100%',
    height: 150,
  },
});

export default InicioView;
